BEGIN TRANSACTION;
CREATE TABLE CURSO
             (CD_INEP                 INT NOT NULL,
              CURSO                   VARCHAR(50) NOT NULL,
              CAMPOS                  VARCHAR(50) NOT NULL,
              CARGA_HORARIO_CURSO     INT,
              PRIMARY KEY(CD_INEP)    
             );
CREATE TABLE DEFICIENCIA
             (COD_DEFICIENCIA         INT NOT NULL,
              NOME                    VARCHAR(100) NOT NULL,
              MULTIPLO                INT NOT NULL,
              TIPO                    VARCHAR(100) NOT NULL,
              PRIMARY KEY(COD_DEFICIENCIA)    
             );
CREATE TABLE DESTINO
             (COD_DESTINO         INT NOT NULL,
              INSTITUIÇÃO          VARCHAR(20),
              PAÍS                 VARCHAR(20),
              PRIMARY KEY(COD_DESTINO)    
             );
CREATE TABLE DISCENTE
             (NU_MATRICULA         INT NOT NULL,
              SEXO                 CHAR(1),
              ESCOLA_DE_ORIGEM     VARCHAR(20),
              COR                  VARCHAR(20),
              COD_INGRESSO         INT NOT NULL,
              COD_DESTINO          INT,
              CD_INEP              INT NOT NULL,
              COD_LOCAL            INT NOT NULL,
              PRIMARY KEY(NU_MATRICULA),
              
              FOREIGN KEY(COD_INGRESSO) REFERENCES FORMA_INGRESSO(COD_INGRESSO),
              FOREIGN KEY(COD_DESTINO) REFERENCES DESTINO(COD_DESTINO),
              FOREIGN KEY(CD_INEP) REFERENCES CURSO(CD_INEP),
              FOREIGN KEY(COD_LOCAL) REFERENCES LOCALIDADE(COD_LOCAL)
             );
CREATE TABLE FORMA_INGRESSO
             (COD_INGRESSO         INT NOT NULL,
              ANO_INGRESSO         INT NOT NULL,
              SEMESTRE_INGRESSO    INT NOT NULL,
              TIPO_INGRESSO        VARCHAR(20) NOT NULL,
              COTAS                VARCHAR(20) NOT NULL,
              PRIMARY KEY(COD_INGRESSO)    
             );
CREATE TABLE LOCALIDADE
             (COD_LOCAL               INT NOT NULL,
              CIDADE                  VARCHAR(100) NOT NULL,
              UF                      VARCHAR(100) NOT NULL,
              PAIS                    VARCHAR(100) NOT NULL,
              PRIMARY KEY(COD_LOCAL)    
             );
CREATE TABLE POSSUI
             (NU_MATRICULA         INT NOT NULL,
              COD_DEFICIENCIA      INT NOT NULL,
              PRIMARY KEY(NU_MATRICULA,COD_DEFICIENCIA),
              FOREIGN KEY(NU_MATRICULA) REFERENCES DISCENTE(NU_MATRICULA),
              FOREIGN KEY(COD_DEFICIENCIA) REFERENCES DEFICIENCIA(COD_DEFICIENCIA)
             );
COMMIT;
